import React, { useState } from 'react';
import AppLayout from '../components/AppLayout';
import Slider from 'react-slick';

const images = [
  '/img/poster1.jpg',
  '/img/poster2.jpg',
  '/img/poster3.jpg',
  '/img/poster4.jpg',
  '/img/poster5.jpg',
];

const Home = () => {
  const settings = {
    isfinite: true,
  };
  return (
    <>
      <AppLayout>
        <Slider>
          {images.map((img, idx) => (
            <div>
              <img src={img} alt={img} />
            </div>
          ))}
        </Slider>
      </AppLayout>
    </>
  );
};

export default Home;
